function ItemsList({articles}) {
  return (
    <div> 
       
        <h1>les articles</h1>
        {
            articles.map(article=>{
             <div>
                {
                    `l'article nom est: ${article.name} , leur prix est: ${article.price}`
                }
             </div>
                
            })
        }


    </div>
  )
}

